    QString fullPath = QString(_serverConfigs["sitesUpdateSlotConfigNames"][_serverIndices.value("sitesUpdateSlotConfigNames")].URL()+"/subscriptions/{subscriptionId}/resourceGroups/{resourceGroupName}/providers/Microsoft.Web/sites/{name}/config/slotConfigNames");
    
    
